import React, { useEffect, useState } from 'react'
import { Row, Col, Container, Card, CardBody } from 'reactstrap';
import SearchFunc from './Main/SearchFunc';
import SearchStatic from './Main/SearchStatic';
import { useSearchParams } from 'react-router-dom';

const Main = () => {

  const [funcImage, setFuncImage] = useState("");
  const [funcEffect, setFuncEffect] = useState("");

  return (
    <div>
      <div>
        <SearchFunc funcImage={funcImage} setFuncImage={setFuncImage} funcEffect={funcEffect} setFuncEffect={setFuncEffect}  />
      </div>
      <div>
        <SearchStatic />
      </div>
    </div>
  )
}

export default Main
